import Head from 'next/head'
import Navbar from './Navbar'
import './Layout.module.css'
import styles from './Layout.module.css'

const Layout = (props) => (
    <div className={styles.Layout}>
        <Head>
            <title>React Ranked Voting</title>
        </Head>
        <Navbar/>
        <main>
            {props.children}
        </main>
    </div>
);

export default Layout;
